import { Button } from 'primereact/button';
import { Card } from 'primereact/card';
import Radiobtn from '../radiobtn/Radiobtn';
import Inputfds from '../inputfileds/Inputfds';
import Dropdownfilteer from '../dropdownfilter/Dropdown';

const Billscomponent = () => {
  const header = (
    <img alt="Card" src="https://primefaces.org/cdn/primereact/images/usercard.png" />
  );
  const footer = (
    <>
      <Button label="Proceed to Pay Bill "style={{justifyContent:"center", alignContent:"center", alignItems:"center", display:"flex", alignSelf:"center"}}/>
    </>
  );
  return (
    <div style={{ backgroundColor: 'whitesmoke', flex: 1, padding: 80 }}>
      <div className="card flex justify-content-center" style={{gap:10}}>
        <Card title="Recharge or Pay Mobile Bill"  className="md:w-25rem" style={{padding:20}}>
          <Radiobtn/>
          <Inputfds/>
         <Dropdownfilteer/>
         <div  style={{display:"flex", paddingTop:10, justifyContent:"center", alignContent:"center"}}>
         <Button label="Proceed to Pay Bill " className="w-full md:w-17rem"/>

          </div>

        </Card>

      </div>
    </div>
  );
};

export default Billscomponent;
